    waterTimer = setInterval(()=>{waterSec++},50);
}

let waterTimeStop = () => {
    clearInterval(waterTimer);
}

let sketchTimeStart = () => {
    sketchTimer = setInterval(()=>{sketchSec++},50);
}

let sketchTimeStop = () => {
    clearInterval(sketchTimer);
}

